import React from "react";
import { Link } from "react-router-dom";
import { CardContent, Grid, Card } from "@mui/material";

export const Addcategory = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={3}>
        <Card>
          <CardContent>
            <h2>Add Category</h2>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
  );
};
